import { configureStore } from "@reduxjs/toolkit";
import { modelReducer, memoryReducer, priceReducer, diagonalReducer, tokenReducer, pageReducer } from "./SpecificationSlice";
import { api } from "./api";

const store = configureStore({
    reducer: {
        model: modelReducer,
        memory: memoryReducer,
        price: priceReducer,
        diagonal: diagonalReducer,
        token: tokenReducer,
        page: pageReducer,
        
        [api.reducerPath]: api.reducer,
    },
    middleware: (getDefaultMiddlware) => getDefaultMiddlware().concat(api.middleware)
});

export default store;
